import React from 'react'

function InputLogin({value, name, class_main_div, font_awesome_class, onChange,}) {
    return (
        <div className={class_main_div}>
          <label>
           
          <i className={font_awesome_class}></i> Email
          </label>
          <input
            onChange={onChange}
            name={name}
            
            id={name}
            type="email"
            value={value}
            placeholder={name}
          />
          <div className={alert} ></div>
        </div>
    )
}

export default InputLogin
